import React, { useState, useEffect } from "react";

const City = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        setData(data.data);
      });
  }, []);
  return (
    <>
      <h1 className="text-center my-3 font-weight-bold">
        TOP 10 CITY TABLE DEPENDING UPON HIGHEST INCOMING USERS
      </h1>
      <div className="text-center">
        <button className="btn btn-dark">
          <a href="/" className="text-decoration-none text-light">
            Back to API TABLE
          </a>
        </button>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Gender</th>
            <th>Income</th>
            <th>City</th>
            <th>Car</th>
            <th>Quote</th>
            <th>Phone price</th>
          </tr>
        </thead>
        <tbody>
          {data.map((d) => {
            var currency = d.income;
            var income = Number(currency.replace(/[^0-9.-]+/g, ""));
            const arr_income = [income];
            function compareNumbers(a, b) {
              return a - b;
            }
            arr_income.sort(compareNumbers)
            for(let i=0;i<10;)
            return (
              <tr>
                <td>{d.id}</td>
                <td>{d.first_name}</td>
                <td>{d.last_name}</td>
                <td>{d.email}</td>
                <td>{d.gender}</td>
                <td>{d.income}</td>
                <td>{d.city}</td>
                <td>{d.car}</td>
                <td>{d.quote}</td>
                <td>{d.phone_price}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </>
  );
};

export default City;
